%[text] # 統計解析(2要因分散分析)
%[text] 目標：MMNが起きているチャンネルを探し，条件間で比較する。
%[text] １．データを扱いやすいように変形させる。
%[text] data\_aveは，３次元目にstd条件とdev条件があるので，
%[text] (dev条件) - (std条件)とデータを変形する。
%[text] ２．さらに，このときの波形を観察してどの期間にMMNが発生してそうか，「MMNが出ていそうな時間窓」を決める。
%[text] ３．その時間窓の平均振幅が 0 と異なるか評価する（1標本t検定）。
%[text] ４．有意だったチャンネルで deviant 3条件（1010/1030/1050 Hz）を比較（反復測定ANOVA）。
%[text] 
%%
%[text] ## １．データを扱いやすいように変形させる。
%[text] MMNの大きさを条件毎に比較したいのでdeviant条件からstandard条件を引く。
%[text] 変数は，data\_av % (ch, time, \[std or var\],\[1010 or 1030 , 1050\],par)
%[text] を使えばよい。
data_dif=squeeze(data_ave(:,:,2,:,:)-data_ave(:,:,1,:,:)); % MMN成分の抽出
%%
%[text] ## ２.1. さらに，このときの波形を観察してどの期間にMMNが発生してそうか，時間帯を調べる。
%[text] チャンネル毎にMMN（deviant - standard）の平均波形を書いてください。006で書いた平均波形と一致することを確認してください。
fs = 1000; % サンプリング周波数
N=size(data_dif,2); % データ長 data(ch,time,blk,knd);% 1->1050 Hz, 2->1010 Hz
marker=zeros(2,2);
marker(:,1)=0.0;
marker(1,2)=-20;
marker(2,2)=20;
 
load('EEG_locs_new.mat');

sz = get(0, 'ScreenSize');

x=linspace(-0.1,(N-100)/fs,N);

figure('Position', [sz(1) sz(2) sz(3) sz(4)]) %[output:522ebb40]
% figure
for chl=1:size(sloc,1)
    subplot('position',[sloc(chl,1) sloc(chl,2) 0.07 0.07]) %[output:522ebb40]
    hold on
    % passive condition (reading)
    h(1) = plot(x, mean(data_dif(chl,:,1,end-6:end),4,'omitnan'), 'Color', [255  75   0]/255, 'LineWidth',2);
    h(2) = plot(x, mean(data_dif(chl,:,2,end-6:end),4,'omitnan'), 'Color', [  0  90 255]/255, 'LineWidth',2);
    h(3) = plot(x, mean(data_dif(chl,:,3,end-6:end),4,'omitnan'), 'Color', [  3 175 122]/255, 'LineWidth',2);
    % attended condition
    h(4) = plot(x, mean(data_dif(chl,:,1,1:end-7),4,'omitnan'), 'Color', [255  75   0]/255, 'LineWidth',2,'LineStyle',':');
    h(5) = plot(x, mean(data_dif(chl,:,2,1:end-7),4,'omitnan'), 'Color', [  0  90 255]/255, 'LineWidth',2,'LineStyle',':');
    h(6) = plot(x, mean(data_dif(chl,:,3,1:end-7),4,'omitnan'), 'Color', [  3 175 122]/255, 'LineWidth',2,'LineStyle',':');
    
    axis('ij')

    ymx=7;
    title([ ch_name{chl} '(' num2str(chl) ')' ]) % titleを付けます。
%     title(ch)
    xlim([-0.1 0.7])
    ylim([-ymx ymx])
    plot(marker(:,1),marker(:,2),'k:','LineWidth',2);
    set(gca,'box','on');
    set(gca,'linewidth',1)
end
legend(h, ... %[output:522ebb40]
 {'1010 Hz (passive)', '1030 Hz (passive)', '1050 Hz (passive)', ... %[output:522ebb40]
  '1010 Hz (attended)', '1030 Hz (attended)', '1050 Hz (attended)'}, ... %[output:522ebb40]
 'Location','southoutside','Orientation','horizontal'); %[output:522ebb40]
