hold on %[output:96fe2ff6]
amp=10;
thr=0.05;

devname = {'1010Hz','1030Hz','1050Hz'};
attname ={'passive','attended'};

% passive condition (reading)
for dev = 1:3
    subplot(2,3,dev) %[output:96fe2ff6]
    Map=squeeze(stats1.tstat(:,:,dev)); %size(1, 31, 3)(1, chl, [1010, 1030 , 1050]);
