%[text] ## 4.2. 伝統的な mixed ANOVA（混合2要因：被験者内×被験者間）。
%[text] - 被験者内：**Deviant（3水準）**
%[text] - 被験者間：**Attention（attended vs passive）**
%[text] - 従属変数：MMN振幅（チャンネルは `chl` 固定） \
%[text] ### 手順
%[text] 1. **wide形式**（各被験者 = 1行、deviant 3条件 = 3列）を作る
%[text] 2. `fitrm`（反復測定モデル）を当てる
%[text] 3. `ranova` で被験者内効果（Deviant）と交互作用（Deviant×Attention）
%[text] 4. `anova` で被験者間効果（Attention） \
%[text] ## 0) 被験者の選び方（7 vs 7 に揃える版）
%[text] 現在の参加者はattendedが13名，passiveが7名なので，passiveの7名に揃えて比較することとします。
% chlの定義
chl=5; % 適当


rng(1);                % 今は再現性のため固定，数字を変更して参加者の組み合わせを変えてみる
idx_att_all = 1:13;    % attended候補
idx_pas     = 14:20;   % passive 7名

idx_att_sub = randsample(idx_att_all, 7);
idx_sel     = [idx_att_sub, idx_pas]; % 合計14名

Attention = [repmat("attended",7,1); repmat("passive",7,1)];
Attention = categorical(Attention);

%[text] ## 1) wide形式データを作る（14×3）
%[text] 各行=被験者、列=deviant(3条件)
Y = squeeze(mmn_amp(chl,:,idx_sel))';  % 期待：14 x 3 になるように転置
% 列の意味：(:,1)=deviant1, (:,2)=deviant2, (:,3)=deviant3
%[text] うまくいってるか確認：
size(Y)   % -> [14 3] を期待 %[output:05d49e45]
%[text] ## 2) fitrm 用のテーブルを作る
Twide = table(Attention, Y(:,1), Y(:,2), Y(:,3), ...
    'VariableNames', {'Attention','Hz1010','Hz1030','Hz1050'});
%[text] 反復測定の水準テーブル（WithinDesign）を作ります：
Within = table(categorical(["Hz1010";"Hz1030";"Hz1050"]), 'VariableNames', {'Deviant'});
%[text] ## 3) 反復測定モデルを当てる
rm = fitrm(Twide, 'Hz1010-Hz1050 ~ Attention', 'WithinDesign', Within);
% rm = fitrm(between,'Hz1010-Hz1050~1','WithinDesign',within); Ⅰ要因の分散分析はこちらでした
%[text] ## 4) mixed ANOVA の結果を出す
%[text] 被験者内（Deviant）と交互作用（Deviant×Attention）
ranovatbl = ranova(rm, 'WithinModel', 'Deviant');
ranovatbl %[output:866ba273]
%[text] ここに出る主な行：
%[text] - `Deviant`
%[text] - `Deviant:Attention`（交互作用） \
%[text] ### **被験者間（Attention 主効果）**
%[text] `fitrm` では between の主効果は **`anova(rm)`** で見ます。
betweenTbl = anova(rm);
betweenTbl %[output:4438e430]
%[text] ここに
%[text] - `Attention`の検定が出ます。 \
%[text] 
%[text] `ranova(rm)` の Attention　と　`anova(rm)` の Attentionは **完全に同じ値**です。
%[text] - within / interaction → `ranova`
%[text] - between → `anova` \
%[text] 解析を分けるのは，どちらが参加者内要因か参加者間要因かを切り分けるためです。
%[text] 値を取り違えてしまわないことができます。
%[text] 
%[text] ### 球面性の検定
%[text] Mauchlyの球面性検定
mau = mauchly(rm) %[output:6a96d95e]
%[text] 一応産出しますが，今回人数が少ないのでＧＧで補正した値で評価してください。
%[text] ### イプシロン調整
%[text] イプシロン係数（Greenhouse-Geisser）を自由度と誤差それぞれにかけて，報告する必要があります。
ep = epsilon(rm) %[output:64d6379c]
%[text] ### 結果の書き方
%[text] 注意条件（attended / passive）と刺激条件（deviant 3水準）の交互作用は有意ではなかった（*F*(1.94, 23.25) = 2.70, *p* = .090）。しかし，注意条件の主効果（*F*(1, 12) = 8.12, *p* = .015）および刺激条件の主効果（*F*(1.94, 23.25) = 8.98, *p* = .001）はいずれも有意であった。
%[text] 
%[text] ## 事後検定（多重比較）
% 'ComparisonType' ? 使用する棄却限界値の種類
% 'tukey-kramer' (既定値) | 'dunn-sidak' | 'bonferroni' | 'scheffe' | 'lsd'
T0 = multcompare(rm,'Deviant') %[output:7e48685e]
T1 = multcompare(rm,'Deviant','ComparisonType','dunn-sidak') %[output:64e0462f]
T2 = multcompare(rm,'Deviant','ComparisonType','bonferroni') %[output:8e300c4b]
T3 = multcompare(rm,'Deviant','ComparisonType','Scheffe') %[output:0506674f]
T4 = multcompare(rm,'Deviant','ComparisonType','lsd') %[output:396c739a]
%%
%[text] ## 交互作用が有意だった場合の解析手順
%[text] ### 方法A：Attentionごとに Deviant の単純主効果を見る
% attended 群のみ
rm_att = fitrm(Twide(Attention=="attended",:), ...
               'd1-d3 ~ 1', 'WithinDesign', Within);
ranova(rm_att, 'WithinModel','Deviant')

% passive 群のみ
rm_pas = fitrm(Twide(Attention=="passive",:), ...
               'd1-d3 ~ 1', 'WithinDesign', Within);
ranova(rm_pas, 'WithinModel','Deviant')
%[text] - attended では deviant 効果あり／なし？
%[text] - passive ではどうか？ \
%[text] ### 方法B：Deviantごとに Attention の単純主効果を見る
for d = 1:3
    y = Y(:,d);
    p = anova1(y, Attention, 'off');
    fprintf('Deviant %d: p = %.3f\n', d, p);
end
%[text] - deviant1 では attended vs passive に差？
%[text] - deviant2 では？
%[text] - deviant3 では？ \
%[text] ### 結果の書き方
%[text] 注意条件と刺激条件の交互作用が有意であった（*F*(1.94, 23.25) = X.XX, *p* = .XXX）。
%[text] **例1：Attention ごとに Deviant を見る場合**
%[text] 単純主効果の検定を行ったところ，attended 条件では刺激条件の効果が有意であった（*F*(1.94, XX) = X.XX, *p* = .XXX）が，passive 条件では有意ではなかった（*F*(1.94, XX) = X.XX, *p* = .XXX）。
%[text] **例2：Deviant ごとに Attention を見る場合**
%[text] deviant1 条件では注意条件の差が有意であった（*F*(1, XX) = X.XX, *p* = .XXX）が，deviant2 および deviant3 条件では有意ではなかった。
%%
%[text] ## バイオリンプロット
devNames = {'1010','1030','1050'};   % deviantラベル（あなたの実名に合わせて）
attNames = {'attended','passive'};

attGroup = [repmat({'attended'},7,1); repmat({'passive'},7,1)];
attGroup = categorical(attGroup, attNames);


% (A) Attention violin用：deviant で平均（被験者ごとに1点）
y_att = mean(Y, 2, 'omitnan');   % 14x1
y_att = reshape(y_att,[7,2]);

% (B) Deviant violin用：attention で平均（被験者ごとに dev 3点）
% ここでは 14名全員の値をそのまま使う（= attention 平均ではなく全体分布）
% 「attentionで平均したdeviant」の厳密版にしたい場合は下のコメント参照
y_dev = Y; % 14x3

%% ===== プロット =====
figure %[output:64d87078]

% ---- subplot 1: Attention (2群) ----
subplot(1,2,1); hold on; %[output:64d87078]
% violinplot は "データベクトル + グループ" 形式が使える実装が多い
violinplot(y_att); %[output:64d87078]
hold on %[output:64d87078]
s = swarmchart(1:1:2,y_att,'filled'); %[output:64d87078]
% set(s, 'SizeData', 15); % 例：20 くらい?
set(s, 'MarkerFaceAlpha', 0.6, 'MarkerEdgeAlpha', 0.6); %[output:64d87078]
boxchart(y_att) %[output:64d87078]

set(gca,'XTickLabel',{'attended condition',  'passive condition (reading)'}); %[output:64d87078]
ylabel('MMN amplitude (\muV)'); %[output:64d87078]
title('Attention (collapsed across deviant)'); %[output:64d87078]
box off; %[output:64d87078]

axis ij; %[output:64d87078]

% sigstar
p_att = betweenTbl.pValue(2);
ss = sigstar({[1 2]}, p_att, 0, 'top');   % 括弧と星 %[output:64d87078]


% ---- subplot 2: Deviant (3水準) ----
subplot(1,2,2); hold on; %[output:64d87078]
% devごとにバイオリンを並べる（列ごと）
% violinplot が行列入力に対応していればこれでOK
violinplot(y_dev); %[output:64d87078]
s = swarmchart(1:1:3,y_dev,'filled'); %[output:64d87078]
% set(s, 'SizeData', 15); % 例：20 くらい?
set(s, 'MarkerFaceAlpha', 0.6, 'MarkerEdgeAlpha', 0.6); %[output:64d87078]
boxchart(y_dev) %[output:64d87078]

axis ij; %[output:64d87078]

% sigstar
groups = {[1 2],[1 3],[2 3]};
pvals  = [T2.pValue(1), T2.pValue(2), T2.pValue(4)];


ss = sigstar(groups, pvals, 0, 'top');   % 括弧と星 %[output:64d87078]
% ss = sigstar(groups, pvals, 0, 'auto');  % 自動（画面上）
% ss = sigstar(groups, pvals, 0, 'bottom');

% 軸・ラベル
set(gca,'XTickLabel',{'1010', '1030', '1050'}); %[output:64d87078]
xlabel('deviant condition (Hz)') %[output:64d87078]
ylabel('MMN amplitude (\muV)'); %[output:64d87078]
title('Deviant (collapsed across attention groups)'); %[output:64d87078]
box off; %[output:64d87078]

% 見やすさ：0ライン
for sp = 1:2 %[output:group:3d9760fd]
    subplot(1,2,sp); %[output:64d87078]
    yline(0,'--');
end %[output:group:3d9760fd]
%%
%[text] ## interaction plot（推奨：群平均±SE + 個人点も重ねる）
% Y: 14x3 (rows: subjects, cols: deviant 1010/1030/1050)
% Attention: 14x1 categorical ("attended","passive")
devHz = [1010 1030 1050];

isAtt = (Attention=="attended");
isPas = (Attention=="passive");

mAtt = mean(Y(isAtt,:), 1, 'omitnan');
mPas = mean(Y(isPas,:), 1, 'omitnan');

seAtt = std(Y(isAtt,:), 0, 1, 'omitnan') ./ sqrt(sum(isAtt));
sePas = std(Y(isPas,:), 0, 1, 'omitnan') ./ sqrt(sum(isPas));

figure; hold on; %[output:513bd207]

% 群平均 ± SE
errorbar(devHz, mAtt, seAtt, '-o', 'LineWidth', 2); %[output:513bd207]
errorbar(devHz, mPas, sePas, '-s', 'LineWidth', 2); %[output:513bd207]

% 個人データ点（薄く）
for i = find(isAtt)'
    plot(devHz, Y(i,:), ':', 'HandleVisibility','off'); %[output:513bd207]
end
for i = find(isPas)'
    plot(devHz, Y(i,:), ':', 'HandleVisibility','off'); %[output:513bd207]
end
xlim([1000 1060]) %[output:513bd207]
set(gca,'XTick',devHz); %[output:513bd207]
xlabel('Deviant (Hz)'); %[output:513bd207]
ylabel('MMN amplitude (\muV)'); %[output:513bd207]
title('Interaction plot: Deviant × Attention'); %[output:513bd207]
legend({'attended (mean±SE)','passive (mean±SE)'}, 'Location','best'); %[output:513bd207]
axis ij;  % ERP慣習（負を上にしたいならこれ） %[output:513bd207]
yline(0,'--','HandleVisibility','off'); %[output:513bd207]
box off; %[output:513bd207]


